import "./App.css";
import NavBar from "./components/NavBar";
import getCoffee from "./components/getCoffee";

function App() {
  return (
    <div className="App">
      <NavBar></NavBar>
      <getCoffee />
      <div className="GreyBox"></div>
    </div>
  );
}

export default App;
